import React from 'react'
import classes from './backButton.module.css'
import { Link } from 'react-router-dom'

const BackButton = (props) => {
  return (
    <Link to={props.path}>
    <button className={`btn--flat ` + classes.BackButton}>
        {props.title}
    </button>
    </Link>
  )
}

export default BackButton
